static PyObject *get_entity_path(SaHpiEntityPathT *ep) {
	PyObject *Ep, *Epel, *o;
	int i, m;
        for (i = 0; i < SAHPI_MAX_ENTITY_PATH; i++) {
                if (ep->Entry[i].EntityType == SAHPI_ENT_ROOT) {
                            break;
                }
        }
	if (i == SAHPI_MAX_ENTITY_PATH) {
		return NULL;
	}

	Ep = PyTuple_New(i + 1);
//	i--;
	m = i;

        /* Parse entity path into a tuple */
	for (; i >= 0; i--) {
		Epel = PyTuple_New(2);
		o = PyInt_FromLong(ep->Entry[i].EntityType);
                PyTuple_SetItem(Epel, 0, o);
		o = PyInt_FromLong(ep->Entry[i].EntityLocation);
                PyTuple_SetItem(Epel, 1, o);
		PyTuple_SetItem(Ep, m - i, Epel);

	}
	return Ep;
}


